import React from "react"
import './style.css';
import gif from './boom.gif'
import verified from './verified.png'

function Header() {
  return (
    <header id="top">
      <div id="work"><img src={gif} alt="workinnit" border="0" /></div>
       {/* <img src="https://i.ibb.co/gDhkRZv/redber.jpg" alt="berserk"/>*/}
        <div id="wr-sec">
          <p id="subtit">
          <img src={gif} alt="workinnit" border="0" />
            Visual Arts</p>
          <p id="name">Ali Naqvi</p>
        </div>
    </header>

  );
}

export default Header;
